$(document).on("click",".mobile-contact",function(e) {
    e.preventDefault();
    var contactList = $(this).find('.mobile-contact-list');
    if (contactList.hasClass('show-block')) {
        contactList.removeClass('show-block');
    } else {
        contactList.addClass('show-block');
    }
})
$('.mobile-contact-list').click(function (e) {
    e.stopPropagation();
})
$("a#to-top-link").click(function() {
    $("html, body").animate({ scrollTop: 0 }, 400);
    return false;
});
$(document).click(function (e){
    var div = $(".mobile-contact");
    if (!div.is(e.target) && div.has(e.target).length === 0) {
        $('.mobile-contact-list').removeClass('show-block');
    }
});
var st = 0;
var scrollPos = 0;
$(window).on('scroll', function(event){
    st = $(this).scrollTop();
    if (st > scrollPos || st < 400){
        $('#to_top_block').removeClass('visible');
    } else {
        $('#to_top_block').addClass('visible');
    }
    scrollPos = st;
});